import React from "react";
import CardFavorites from "./CardFavorites.jsx";
import axios from "axios";

const Favorites = () => {
  const [movies, setMovies] = React.useState([]);

  React.useEffect(() => {
    axios.get("/api/favorites").then((info) => console.log(info));
  }, []);

  return (
    <React.Fragment>
      {favorites?.map((fav, i) => {
        return <CardFavorites key={i} movieID={fav} />;
      })}
    </React.Fragment>
  );
};

export default Favorites;
